import React from 'react';
import Todo from './todo'
const { useState } = React;
const TodoList = (props) => {
    return(
        <div>
            {
                props.todos.map(todo => (
                    <Todo {...todo}/>
                ))
            }
        </div>
    );
}

export default TodoList;
